import React from "react";
import "./hackertyper/style.css";
import mytext from "./text.js";

class Hackertyper extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      text: [],
      timerKey: 0,
      textStart: null
    };
  }
}
export default Hackertype;
